import React from "react";
import CardList from "./CardList";
import { robots } from "./robots";

const App = () => {
  return (
    <fragment>
      <h1>Robofriends</h1>
      <SearchBox />
      <CardList robots={robots} />;
    </fragment>
  );
};

export default App;
